import './App.css';
import * as React from 'react';
import Header from "./pages/include/header.js";
import Footer from "./pages/include/footer.js";
import LeftMenu from "./pages/include/left_menu.js";
import CntTable from "./pages/cnt_table.js";
import CntTest from "./pages/cnts/cnttest.js";
import CntTest2 from "./pages/cnts/cnttest2.js";
import { BrowserRouter } from 'react-router-dom';

const App = () => {


  return ( 
    <BrowserRouter>
      <div className="App">
        <div className="wrap">
            <div className="back_lm"></div>
            <LeftMenu />
            <body className="app-body">
              <Header />
              <Routes>
                  <Route path="/" element={<CntTest />} />
                  <Route path="homepage" element={<CntTest />}/>
                  <Route path="profile" element={<CntTest2 />}/>
              </Routes>
              <Footer />
            </body>
        </div>
      </div>


    </BrowserRouter>
  );
};

export default App;
